class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        slist = list(s)
        tlist = list(t)
        if len(slist) <1:
            return tlist[0]
        else:
            slist.sort()
            tlist.sort()
            for i in range(len(slist)):
                if slist[i] != tlist[i]:
                    return tlist[i]
            
            
        return tlist[len(slist)]
res = Solution()
print(res.findTheDifference("", "y"))
print(res.findTheDifference("abcd", "abcde"))
print(res.findTheDifference("a", "aa"))



